import React from 'react';

function About() {
    return (
        <div>
            <h1>About Us</h1>
            <p>
                We are a team of passionate students and researchers dedicated to advancing synthetic biology through iGEM competitions. Our goal is to innovate and contribute to the global community by developing novel solutions to real-world problems.
            </p>
            <p>
                Our team consists of experts in various fields such as biology, engineering, computer science, and design. We work collaboratively to bring our ideas to life and make a meaningful impact.
            </p>
        </div>
    );
}

export default About;
